import React, { useState, useEffect, useRef } from 'react';
import ForceGraph2D from "react-force-graph-2d";
import * as d3 from "d3";

const myData = {
    "nodes": [ 
        { 
          "id": "id1",
          "name": "name1",
          "val": 1 
        },
        { 
          "id": "id2",
          "name": "name2",
          "val": 10 
        },
    ],
    "links": [
        {
            "source": "id1",
            "target": "id2"
        },
    ]
}

export const GraphView =() =>{
    const graphRef = useRef(null);

    return(
        <ForceGraph2D
            width={window.innerWidth}
            height={650}
            graphData={myData}
        />
    )
}
